import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav className="App-header_navegation">
          <figure className="navegation_boxImg"></figure>
          <ul className="navegation_boxlist">
            <li></li>
            <li></li>
            <li></li>
            <li></li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
